CREATE VIEW learning_data AS
 SELECT g."refObjectClass",
    g."viewNumber",
    g."cumulativeMass",
    g."DAGCost",
    g."fileOffset",
    g."MaxTSVDimension",
    g."totalTSVSum",
    g."shape_xMax",
    g."shape_xMin",
    g."shape_yMax",
    g."shape_yMin",
    g."shape_Height",
    g."shape_Width",
    n."nodeCount",
    e."edgeCount",
    p."pointCount",
    n.avg_level,
    n.avg_mass,
    n.avg_type AS "avg_NodeType",
    n.avg_role,
    n."avg_pointCount",
    n."avg_contourLength1",
    n."avg_contourLength2",
    n."avg_subtreeCost",
    n."avg_tsvNorm",
    p."avg_xCoord",
    p."avg_yCoord",
    p.avg_radius,
    p.avg_speed,
    p.avg_dr_ds,
    p.avg_dr,
    p.avg_type AS "avg_PointType",
    p.avg_direction
   FROM ((("Graph" g
     LEFT JOIN ( SELECT count(*) AS "nodeCount",
            avg("Node".level) AS avg_level,
            avg("Node".mass) AS avg_mass,
            avg("Node".type) AS avg_type,
            avg("Node".role) AS avg_role,
            avg("Node"."pointCount") AS "avg_pointCount",
            avg("Node"."contourLength1") AS "avg_contourLength1",
            avg("Node"."contourLength2") AS "avg_contourLength2",
            avg("Node"."subtreeCost") AS "avg_subtreeCost",
            avg("Node"."tsvNorm") AS "avg_tsvNorm",
            "Node"."refGraph"
           FROM "Node"
          GROUP BY "Node"."refGraph") n ON ((g."idGraph" = n."refGraph")))
     LEFT JOIN ( SELECT count(*) AS "edgeCount",
            "Edge"."refGraph"
           FROM "Edge"
          GROUP BY "Edge"."refGraph") e ON ((g."idGraph" = e."refGraph")))
     LEFT JOIN ( SELECT count(*) AS "pointCount",
            avg("Point"."xCoord") AS "avg_xCoord",
            avg("Point"."yCoord") AS "avg_yCoord",
            avg("Point".radius) AS avg_radius,
            avg("Point".speed) AS avg_speed,
            avg("Point".dr_ds) AS avg_dr_ds,
            avg("Point".dr) AS avg_dr,
            avg("Point".type) AS avg_type,
            avg("Point".direction) AS avg_direction,
            "Point"."refGraph"
           FROM "Point"
          GROUP BY "Point"."refGraph") p ON ((g."idGraph" = p."refGraph")))
  ORDER BY g."idGraph";


ALTER TABLE learning_data OWNER TO postgres;

